
var nameArray = ["Arial Nova", "Arial Nova", "Calibri", "Calibri", "Century Gothic", "Corbel", "Font_mangelica", "Franklin Gothic Heavy", "Gabriola", "Lucida Sans Unicode", "Wingdings", "Wingdings 2"];

var dataArray = ["", "", "", "", "", "", "", "", "", "", "", ""];

var fontStretch = ["", "", "", "", "", "", "", "", "", "", "", ""];

var fontWeight = ["normal", "bold", "normal", "bold", "normal", "normal", "normal", "normal", "normal", "normal", "normal", "normal"];

var fontStyleSubArray0 = ["normal"];

var fontStyleSubArray1 = ["normal"];

var fontStyleSubArray2 = ["normal"];

var fontStyleSubArray3 = ["normal"];

var fontStyleSubArray4 = ["normal"];

var fontStyleSubArray5 = ["normal"];

var fontStyleSubArray6 = ["normal"];

var fontStyleSubArray7 = ["normal"];

var fontStyleSubArray8 = ["normal"];

var fontStyleSubArray9 = ["normal"];

var fontStyleSubArray10 = ["normal"];

var fontStyleSubArray11 = ["normal"];

var fontStyle = [fontStyleSubArray0, fontStyleSubArray1, fontStyleSubArray2, fontStyleSubArray3, fontStyleSubArray4, fontStyleSubArray5, fontStyleSubArray6, fontStyleSubArray7, fontStyleSubArray8, fontStyleSubArray9, fontStyleSubArray10, fontStyleSubArray11];

function buildFontRule(fontFamily, fontData, fontStyle, fontWeight, fontStretch)
{
	if(fontStyle)
	{
	returnValue = "@font-face { font-family:\"" + fontFamily + "\"; font-style:" + fontStyle + ";";
	if(fontWeight)
	{
		returnValue += "font-weight:" + fontWeight + ";";
	}
	if(fontStretch)
	{
		returnValue += "font-stretch:" + fontStretch + ";";
	}

	returnValue += "src:url(\"data:font/opentype;base64," + fontData + "\"); }";
	return returnValue;
	}
	else 
	{
	return "";
	}
}

for (var i in dataArray)
{
for (var j in fontStyle[i])
	{
		document.write("<style>" + buildFontRule(nameArray[i], dataArray[i], fontStyle[i][j], fontWeight[i], fontStretch[i]) + "</style>");
	}
}
